import React from 'react';
import '../App/App.css';
import { BrowserRouter, Route, Switch} from 'react-router-dom';
import Authentication from '../Authentication/Authentication';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Switch>
          <Route path='/'>
            <Authentication />
          </Route>

        </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
